import React from 'react';

import ScheduleFrameCol from '../ScheduleFrameCol/ScheduleFrameCol';

import styles from './ScheduleFrameRow.module.css';

function getWeekDay(strDay) {
	return (Number.parseInt(strDay) + 6) % 7;
}

export default ({ row, handleClick }) => {
	const columns = [];
	row.map(item => {columns[getWeekDay(item['weekDay'])] = item;})

	for (let i = 0; i < 7; i++) {
		columns[i] = <ScheduleFrameCol col={columns[i]} />
	}

//  onClick={() => handleClick(date)}
	return (
  	<tr className={styles.row}>
			{columns}
		</tr>
	);
};
